import { useState, useEffect } from 'react';
import { Grid, List, Search, X, SlidersHorizontal } from 'lucide-react';
import PlayerCard from '../components/PlayerCard';
import { players } from '../data/players';
import Header from '../components/Header';

const MainPage = ({ navigateToPage }) => {
  const [viewMode, setViewMode] = useState('grid');
  const [searchTerm, setSearchTerm] = useState('');
  const [filters, setFilters] = useState({
    team: 'جميع الأندية',
    age: 'جميع الأعمار',
    rating: 'جميع التقييمات'
  });
  const [isLoading, setIsLoading] = useState(true);
  const [selectedPlayers, setSelectedPlayers] = useState([]);
  const [showFilters, setShowFilters] = useState(false);

  useEffect(() => {
    // Simulate loading
    setTimeout(() => setIsLoading(false), 1000);
  }, []);

  const handleCompare = (player) => {
    setSelectedPlayers(prev => {
      if (prev.find(p => p.id === player.id)) {
        return prev.filter(p => p.id !== player.id);
      }
      if (prev.length < 2) {
        return [...prev, player];
      }
      return prev;
    });
  };

  const clearFilters = () => {
    setFilters({
      team: 'جميع الأندية',
      age: 'جميع الأعمار',
      rating: 'جميع التقييمات'
    });
    setSearchTerm('');
  };

  const filteredPlayers = players.filter(player => {
    const matchesSearch = player.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         player.team.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesTeam = filters.team === 'جميع الأندية' || player.team === filters.team;
    const matchesAge = filters.age === 'جميع الأعمار' || 
                      (filters.age === '20-25' && player.age >= 20 && player.age <= 25) ||
                      (filters.age === '26-30' && player.age >= 26 && player.age <= 30);
    const matchesRating = filters.rating === 'جميع التقييمات' ||
                         (filters.rating === '90+' && player.successRate >= 90) ||
                         (filters.rating === '80-89' && player.successRate >= 80 && player.successRate < 90);

    return matchesSearch && matchesTeam && matchesAge && matchesRating;
  });

  if (isLoading) {
    return <div className="min-h-screen bg-gray-50 flex items-center justify-center">
      <div className="animate-spin rounded-full h-32 w-32 border-t-2 border-b-2 border-green-700"></div>
    </div>;
  }

  return (
    <div className="min-h-screen bg-gray-50">
      <Header navigateToPage={navigateToPage} />

      {selectedPlayers.length > 0 && (
        <div className="fixed bottom-0 left-0 right-0 bg-white shadow-lg p-4 flex justify-between items-center">
          <div className="flex items-center">
            <span className="ml-4">تم اختيار {selectedPlayers.length} لاعبين</span>
            {selectedPlayers.map(player => (
              <div key={player.id} className="flex items-center ml-2">
                <img src={player.image} alt={player.name} className="w-8 h-8 rounded-full" />
                <span className="ml-2">{player.name}</span>
              </div>
            ))}
          </div>
          <div className="flex items-center">
            <button 
              onClick={() => setSelectedPlayers([])}
              className="ml-4 text-gray-500 hover:text-gray-700"
            >
              إلغاء
            </button>
            <button 
              onClick={() => navigateToPage('comparisons', selectedPlayers)}
              className="bg-green-700 text-white px-4 py-2 rounded-md hover:bg-green-800"
            >
              مقارنة
            </button>
          </div>
        </div>
      )}

      <div className="container mx-auto p-6">
        <div className="flex justify-between items-center mb-6">
          <div className="flex items-center">
            <h1 className="text-xl font-bold ml-4">أفضل اللاعبين</h1>
            <div className="flex items-center">
              <select 
                className="border rounded-md p-2 mx-2"
                value={filters.team}
                onChange={(e) => setFilters({ ...filters, team: e.target.value })}
              >
                <option>جميع الأندية</option>
                <option>النصر</option>
                <option>الهلال</option>
                <option>الاتحاد</option>
              </select>
              <select 
                className="border rounded-md p-2 mx-2"
                value={filters.age}
                onChange={(e) => setFilters({ ...filters, age: e.target.value })}
              >
                <option>جميع الأعمار</option>
                <option>20-25</option>
                <option>26-30</option>
              </select>
              <select 
                className="border rounded-md p-2 mx-2"
                value={filters.rating}
                onChange={(e) => setFilters({ ...filters, rating: e.target.value })}
              >
                <option>جميع التقييمات</option>
                <option>90+</option>
                <option>80-89</option>
              </select>
              <div className="border rounded-md p-2 mx-2 flex items-center">
                <Search size={16} className="ml-2 text-gray-400" />
                <input 
                  type="text" 
                  placeholder="البحث عن لاعب..." 
                  className="outline-none bg-transparent"
                  value={searchTerm}
                  onChange={(e) => setSearchTerm(e.target.value)}
                />
              </div>
            </div>
          </div>
          <div className="flex border rounded-md">
            <button 
              className={`p-2 ${viewMode === 'grid' ? 'bg-gray-100' : 'bg-white'}`}
              onClick={() => setViewMode('grid')}
            >
              <Grid size={16} />
            </button>
            <button 
              className={`p-2 ${viewMode === 'list' ? 'bg-gray-100' : 'bg-white'}`}
              onClick={() => setViewMode('list')}
            >
              <List size={16} />
            </button>
          </div>
        </div>

        <div className="flex">
          {/* Right Sidebar */}
          <div className="w-64 ml-6">
            <h2 className="font-bold mb-4">أفضل اللاعبين</h2>
            <div className="space-y-2 mb-8">
              {players.slice(0, 4).map(player => (
                <div key={player.id} className="flex items-center justify-between">
                  <div className="flex items-center">
                    <img 
                      src={player.image} 
                      alt={player.name} 
                      className="w-8 h-8 rounded-full ml-2"
                    />
                    <div>
                      <div className="font-bold">{player.name}</div>
                      <div className="text-gray-500 text-sm">{player.team}</div>
                    </div>
                  </div>
                  <span className={`px-2 py-1 rounded text-xs ${
                    player.successRate >= 90 ? 'bg-green-100 text-green-800' : 'bg-gray-100'
                  }`}>
                    {player.successRate}%
                  </span>
                </div>
              ))}
            </div>

            <h2 className="font-bold mb-4">آخر المباريات</h2>
            <div className="space-y-4">
              {Array(5).fill().map((_, i) => (
                <div key={i}>
                  <div className="flex items-center justify-between text-sm">
                    <span>2:1</span>
                    <span>الهلال vs النصر</span>
                  </div>
                  <div className="text-green-500 text-sm">4 تصديات</div>
                </div>
              ))}
            </div>
          </div>

          {/* Main Content */}
          <div className="flex-1">
            <div className={viewMode === 'grid' ? 'grid grid-cols-3 gap-6' : 'space-y-4'}>
              {filteredPlayers.map(player => (
                <PlayerCard 
                  key={player.id} 
                  player={player} 
                  onCompare={handleCompare}
                  isCompared={selectedPlayers.find(p => p.id === player.id) !== undefined}
                  onClick={() => navigateToPage('playerDetails', player)}
                />
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MainPage;
